'''
Kattis - Prime Path
Precompute the adjacency list and prime list and then run BFS on it.

Time: O(1?), Mem: O(1?)
'''
'''
_sieve_size = 0
bs = []
primes = []

def sieve(upperbound=1060000):
    global _sieve_size
    _sieve_size = upperbound+1
    bs = [True] * _sieve_size
    bs[0] = bs[1] = False
    for i in range(2, _sieve_size):
        if bs[i]:
            for j in range(i*i, _sieve_size, i):
                bs[j] = False
            if (i >= 1000):
                primes.append(i)
sieve(10000)

def differ_by_1(a, b):
    # returns true if a and b differ by 1 digit
    x = [int(i) for i in str(a)]
    y = [int(i) for i in str(b)]
    
    return sum([1 for i in range(4) if x[i] != y[i]]) == 1

adjlist = [list(filter(lambda x: differ_by_1(primes[x], primes[i]), (list(range(len(primes))))))
           for i in range(len(primes))]

print(adjlist)
'''
